graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "Address" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Address</b> <i>&lt;type&gt;</i></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="street__key" align="left" balign="left">street : string</td><td port="street__value" align="left" balign="left">null</td></tr><tr><td port="city__key" align="left" balign="left">city : string</td><td port="city__value" align="left" balign="left">null</td></tr><tr><td port="zipCode__key" align="left" balign="left">zipCode : string</td><td port="zipCode__value" align="left" balign="left">null</td></tr></table></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000", URL="#L1:0-5:1"];
  "User" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>User</b> <i>&lt;type&gt;</i></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="name__key" align="left" balign="left">name : string</td><td port="name__value" align="left" balign="left">null</td></tr><tr><td port="email__key" align="left" balign="left">email : string</td><td port="email__value" align="left" balign="left">null</td></tr><tr><td port="address__key" align="left" balign="left">address : Address</td><td port="address__value" align="left" balign="left">null</td></tr></table></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000", URL="#L7:0-11:1"];
  "userService" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>userService</b> <i>&lt;task&gt;</i></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="currentUser__key" align="left" balign="left">currentUser : User</td><td port="currentUser__value" align="left" balign="left">{<BR/>  &quot;name&quot;: &quot;Alice&quot;,<BR/>&quot;email&quot;: &quot;alice@example.com&quot;,<BR/>  &quot;address&quot;: {<BR/>    &quot;street&quot;: &quot;123 Main St&quot;,<BR/>    &quot;city&quot;: &quot;Springfield&quot;,<BR/>    &quot;zipCode&quot;: 12345<BR/>  }<BR/>}</td></tr></table></td></tr></table>>, pad=0.5, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2", URL="#L13:0-23:1"];

}
